        var keys = [];
        var vals = [];
        var num = 0;
        var frmtedStr = '';
        splStr.forEach(function (str) {
            if (str) {
                var stlSpl = str.split(":");
                keys.push(stlSpl[0]);
                vals.push(stlSpl[1]);
                num++;
            }
        });
        frmtedStr = frmtedStr + "{";
        for (var i = 0; i < num; i++) {
            frmtedStr = frmtedStr + "\"" + keys[i].trim() + "\":\"" + vals[i].trim() + "\"";
            if (i != num - 1) {
                frmtedStr = frmtedStr + ",";
            }
        }
